roximadamente 50% dos municípios não possuíam nem esgoto e saneamento. Assim, quando o dinheiro existia, todo mundo estava &quot;feliz&quot;, já que os governos petistas não mexiam no vespeiro de ninguém. O problema é que o dinheiro acaba, e sem, estas reformas estruturais, a coisa volta a ESTACA ZERO. Ou até piora, já que há um grande tempo perdido.', 'textOriginal': 'As 5 principais razões porque não voto em Lula ou qualquer político do PT
1) Um país só cresce, com o aumento da PRODUTIVIDADE. Se você perguntar porque os EUA são mais ricos que o Brasil, isso se dá porque um trabalhador médio americano produz 4x mais em média que 1 brasileiro. Esse tipo de discurso (MELHORIA DE PRODUTIVIDADE, MELHOR GESTÃO, etc.), nem de longe passa perto dos discursos de Lula ou do PT. Parece que falar em LIVRE INICIATIVA, EMPREENDEDORISMO é algo anátema;
2) É um tipo de governo que busca distribuir algumas migalhas para minorias se sentirem falsamente "empoderadas". Porém, um governo não é eleito para minoria, mas, sim, para TODA A POPULAÇÃO, pois todos nós pagamos impostos e muito. Para ter uma ideia, só em julho passado, foram 220 BILHÕES de reais;
3) A corrupção nos governos petistas foi uma coisa fora do normal. E não havia como ser diferente, quando é um partido que defende um país inchado, com um monte de cargos políticos divididos nos partidos que dão sustentação. Foi impressionante ver como as empresas públicas foram surrupiadas, fundos de pensão, etc.;
4) No Brasil, em face das gritantes diferenças sociais, há entre as pessoas muito ressentimento social, inveja. E a ideologia de Lula e do PT é exatamente trabalhar em cima destes sentimentos ruins que a população carrega há tempos, para tentar conseguir mais votos. É a aposta de que tendo mais pobres no Brasil, manipulando-os, será mantido no projeto de poder. Aí, nasce, sem dúvida, o "nós contra eles", "o nunca antes neste país", o jogar pobres contra ricos, etc. NÃO DÁ;
5) Quando o PT esteve no poder não fez NENHUMA REFORMA ESTRUTURAL. Zero. Não houve reforma política, tributária, etc. Para se ter uma ideia, fizeram obras no exterior, mas, aproximadamente 50% dos municípios não possuíam nem esgoto e saneamento. Assim, quando o dinheiro existia, todo mundo estava "feliz", já que os governos petistas não mexiam no vespeiro de ninguém. O problema é que o dinheiro acaba, e sem, estas reformas estruturais, a coisa volta a ESTACA ZERO. Ou até piora, já que há um grande tempo perdido.', 'authorDisplayName': 'Leandro Felipe Bueno Tierno', 'authorProfileImageUrl': 'https://yt3.ggpht.com/ytc/AGIKgqMgW-RJU2ladCTbqjDqb6LXcra0BN8_Ohep2u3-Xg=s48-c-k-c0x00ffffff-no-rj', 'authorChannelUrl': 'http://www.youtube.com/channel/UCtwv3CojlYQ4gj6cQunKsSA', 'authorChannelId': {'value': 'UCtwv3CojlYQ4gj6cQunKsSA'}, 'canRate': True, 'viewerRating': 'none', 'likeCount': 0, 'publishedAt': '2022-10-28T18:23:07Z', 'updatedAt': '2022-10-28T18:23:07Z'}}, 'canReply': True, 'totalReplyCount': 0, 'isPublic': True}

textOriginal:
As 5 principais razões porque não voto em Lula ou qualquer político do PT
1) Um país só cresce, com o aumento da PRODUTIVIDADE. Se você perguntar porque os EUA são mais ricos que o Brasil, isso se dá porque um trabalhador médio americano produz 4x mais em média que 1 brasileiro. Esse tipo de discurso (MELHORIA DE PRODUTIVIDADE, MELHOR GESTÃO, etc.), nem de longe passa perto dos discursos de Lula ou do PT. Parece que falar em LIVRE INICIATIVA, EMPREENDEDORISMO é algo anátema;
2) É um tipo de governo que busca distribuir algumas migalhas para minorias se sentirem falsamente "empoderadas". Porém, um governo não é eleito para minoria, mas, sim, para TODA A POPULAÇÃO, pois todos nós pagamos impostos e muito. Para ter uma ideia, só em julho passado, foram 220 BILHÕES de reais;
3) A corrupção nos governos petistas foi uma coisa fora do normal. E não havia como ser diferente, quando é um partido que defende um país inchado, com um monte de cargos políticos divididos nos partidos que dão sustentação. Foi impressionante ver como as empresas públicas foram surrupiadas, fundos de pensão, etc.;
4) No Brasil, em face das gritantes diferenças sociais, há entre as pessoas muito ressentimento social, inveja. E a ideologia de Lula e do PT é exatamente trabalhar em cima destes sentimentos ruins que a população carrega há tempos, para tentar conseguir mais votos. É a aposta de que tendo mais pobres no Brasil, manipulando-os, será mantido no projeto de poder. Aí, nasce, sem dúvida, o "nós contra eles", "o nunca antes neste país", o jogar pobres contra ricos, etc. NÃO DÁ;
5) Quando o PT esteve no poder não fez NENHUMA REFORMA ESTRUTURAL. Zero. Não houve reforma política, tributária, etc. Para se ter uma ideia, fizeram obras no exterior, mas, aproximadamente 50% dos municípios não possuíam nem esgoto e saneamento. Assim, quando o dinheiro existia, todo mundo estava "feliz", já que os governos petistas não mexiam no vespeiro de ninguém. O problema é que o dinheiro acaba, e sem, estas reformas estruturais, a coisa volta a ESTACA ZERO. Ou até piora, já que há um grande tempo perdido.

